const CartItem = (props) =>{
	 return(
		 <div>
			 <span>{props.id}</span>
			 <span>{props.name}</span>
			 <span>{props.price}</span>
			 <span>{props.number}</span>
		 </div>

	 )
	 }
	 export default CartItem;
